import { Extent } from 'ol/extent';

import { BotObstacleLabel } from '../../store/vacuum/mapSlice.type';

// TODO get all this from backend
export const mapWidth = 1600;
export const mapHeight = 1600;
export const pixelWidth = 50;
export const PixelRatio = 2;

export const BOT_ICON =
  '';
export const CHARGING_DOCK_ICON =
  '';

export const RECOGNIZED_OBJECTS_ICON_LIST: BotObstacleLabel = {
  /* mat   */ 1: '',
  /* cloth */ 3: '',
  /* chair */ 4: '',
  /* shoe  */ 5: '',
  /* wire  */ 6: '',
};

export const getAngle = (angle: number) => angle * -1 * (Math.PI / 180);

/*
 ** convert Bot coordinate to OpenLayer Coordinates
 */
export const getCoordinates = (value: number, axis: 'x' | 'y') =>
  ((value / pixelWidth) * PixelRatio + (axis === 'x' ? mapWidth : mapHeight) / 2) >> 0;

/*
 ** convert OL coordinate to Bot Coordinates
 ** `[minx, miny, maxx, maxy]`.
 */
export const setCoordinates = (extend: Extent) =>
  extend.map(
    (value, index) =>
      (((value - (index === 0 || index === 2 ? mapWidth : mapHeight) / 2) * pixelWidth) / PixelRatio) >> 0,
  );
